scriptlet.script:
var verifiedParents = scriptletContext.get("verifiedParents");
var groupDNToStart = scriptletContext.get("groupDNToStart");

if ( (typeof(verifiedParents) == 'undefined') || (verifiedParents == "") )
    verifiedParents = groupDNToStart;
else
    if (verifiedParents.indexOf(groupDNToStart) == -1)
        verifiedParents += ";" + groupDNToStart;

scriptletContext.putGlobal("verifiedParents",verifiedParents);

var parents = scriptletContext.get("parents");
var getParentDNResult = scriptletContext.get("getParentDNResult");

if ( (typeof(parents) == 'undefined') || (parents == "") )
    parents = getParentDNResult;
else
    parents += ";" + getParentDNResult;

scriptletContext.put("parents",parents);
